  import { View, Text } from "react-native";
  import {useForm, Controller} from 'react-hook-form';
  import { TextInput, Button } from "react-native-paper";

  export default function HomeScreen({navigation, route}){

      const {
          control, reset,
          handleSubmit,
          formState:{errors},
      } = useForm({
          defaultValues: {
              placa:"",
              brand:"",
              email:"",
              password:"",
              uri:"",
              age:"",
          },
      });
      const onSubmit = (data)=> {
        console.log(data);
      }
      return(
          <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center'}}>
              <Text>Bienvenido {route.params.email}</Text>
              <Controller
                control={control}
                rules={{
                    required: true,
                    maxlength:20,
                    minlength:1,
                    pattern:/^[0-9]+$/
                }}
                render={({field:{onChange,onBlur,value}}) =>(
                    <TextInput
                        label="Numero de Placa" style={{fontFamily: 'inital'}}
                        onBlur={onBlur}
                        onChangeText={onChange}
                        value={value}
                    />
                )}
                name="placa"
                />
                {errors.placa?.type == "required" && <Text style={{color:'red'}}>Numero de placa es obligatorio.</Text>}
                {errors.placa?.type == "maxlength" && <Text style={{color:'red'}}>La longitud debe ser de 20.</Text>}
                {errors.placa?.type == "minlength" && <Text style={{color:'red'}}>La longitud minima debe ser de 1.</Text>}
                {errors.placa?.type == "pattern" && <Text style={{color:'red'}}>Solo debe ingresar numeros.</Text>}

            <Controller
              control={control}
              rules={{
                  required:true,
                  maxlength:10,
                  minlength:1,
                  pattern: /^[A-ZÑa-zñáéíóúÁÉÍÓÚ'° ]+$/,
                  //Ingresar numeros para eso se usa el pattern
                }}
                render={({ field: {onChange,onBlur,value}})=>(
                  <TextInput
                  style={{fontFamily:'inital'}}
                  label="Marca"
                  onBlur={onBlur}
                  onChangeText={onChange}
                  value={value}
                />
              )}
              name="brand"
            />
            {errors.brand?.type == "required" && <Text style={{color:'red'}}>Escribe la marca.</Text>}
            {errors.brand?.type == "maxLength" && <Text style={{color:'red'}}>La longitud debe ser de 10.</Text>}
            {errors.brand?.type == "minLength" && <Text style={{color:'red'}}>La longitud mínima debe ser de 1</Text>}
            {errors.brand?.type == "pattern" && <Text style={{color:'red'}}>.</Text>}

            <Controller
              control={control}
              rules={{
                  required:true,
                  maxlength:0,
                  minlength:1,
                  pattern:/^[A-ZÑa-zñáéíóúÁÉÍÓÚ'° ]+$/,
                }}
                render={({ field: {onChange,onBlur,value}})=>(
                  <TextInput
                  style={{fontFamily:'inital'}}
                  label="Estado del vehiculo"
                  onBlur={onBlur}
                  onChangeText={onChange}
                  value={value}
                />
              )}
              name="email"
            />
            {errors.email?.type == "required" && <Text style={{color:'red'}}>Es obligatorio saber si esta disponible o no esta disponible.</Text>}
            {errors.email?.type == "maxLength" && <Text style={{color:'red'}}>La longitud debe ser de 20</Text>}
            {errors.email?.type == "minLength" && <Text style={{color:'red'}}>La longitud mínima debe ser de 1.</Text>}
            {errors.email?.type == "pattern" && <Text style={{color:'red'}}>.</Text>}
            


            <Button
                  style={{marginTop:20, backgroundColor:'powderblue'}}
                  icon="content-save"
                  mode="outlined"
                  onPress={handleSubmit(onSubmit)}
                  >
                    Guardar
                  </Button>
              {/*<Button title="submit" onPress={handlesubmit(onSubmit)}/> */}
          </View>
      );
  }
